import React from 'react'
import Productos from '../components/productos'

function Principal(){
    const estilos = {
        textAlign: "center"
    }
    return (
        <div >
            <Carousel />
            <div className = "container-fluid">
                <h1 style = {estilos}>Catalogo</h1>
                <Productos />  
            </div>
        </div>
        )
}

export default Principal
